import React, {
  useState,
  useEffect
} from "react";
import ReactDOM from "react-dom";
import "./index.css";

function TopAdsData () {
  const [data, setData] = useState(null);
  useEffect(() => {

      fetch(`https://api.smartly.io/stats/v2/view/29457?token=04b9d710079c0227dfc0f6924f98c80d&timeframe=last_7_days&timezone=America/Los_Angeles&format=json`)
      .then(res => res.json())
      .then(setData)
      .catch(console.error);
  }, []);

  if (data) {
    return (
      <div>
        <h1>{data.Impressions}</h1>
      </div>
    );
  }
  return null;
}

function App() {
  return <TopAdsData/>;
}

ReactDOM.render(
  <App />,
  document.getElementById("root")
);
